import React from 'react';
import { user } from '../auth/index';

class User extends React.Component {

    constructor() {
        super();
        this.state = {
            user: []
        }
    }

    componentDidMount() {
        user().then
    }


    render() {
        return (
            <div className="jumbotron">
                <h1>User</h1>
            </div>
        );
    }
}

export default User;
